import {React, useEffect, useState} from 'react'
import './Home.css'
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import TwitterIcon from '@material-ui/icons/Twitter';
import GitHubIcon from '@material-ui/icons/GitHub';
import TelegramIcon from '@material-ui/icons/Telegram';


const date = new Date();


function Home() {


    const [time, setTime] = useState({
        hours: date.getHours(),
        minutes: date.getMinutes(),
        seconds: date.getSeconds()
      });
      useEffect(() => {
        const timer = setInterval(() => {
          const date = new Date();
          setTime({
            hours: date.getHours(),
            minutes: date.getMinutes(),
            seconds: date.getSeconds()
          });
        }, 1000);
        return () => clearInterval(timer);
      }, []);



    return (
        <div className="home" id='home'>
            <div className="home__data">
                <h1 className="home__title">
                    Hey!,<img  src="https://raw.githubusercontent.com/ABSphreak/ABSphreak/master/gifs/Hi.gif" alt='' width="50px"></img><br/>
                    I'am <span>Pranavdhar</span><br/>
                    Web Developer<br/>
                    {time.hours}:{time.minutes}:{time.seconds}</h1>
                <div className="home__img">    
                    <img src="assets/myimg.png" alt=""></img>
                </div>
            </div>
                <div className="home__social">
                    <a href="https://www.linkedin.com/in/sai-pranavdhar-reddy-nalamalapu-038104206/" className="home__social-icon">
                        <LinkedInIcon className='icon'/>
                    </a>
                    <a href="https://twitter.com/Pranavdhar8" className="home__social-icon">
                        <TwitterIcon className='icon'/>
                        </a>
                    <a href="https://github.com/iampranavdhar" className="home__social-icon">
                        <GitHubIcon className='icon'/>
                        </a>
                    <a href="#home" className="home__social-icon">
                        <TelegramIcon className='icon'/>
                    </a>
                </div>
        </div>
    )
}

export default Home
